			} else if (f.left + f.width <= x) {

				}
			}
		}

			const y = reverse ? h * 16 : canvasHeight - (h + 1) * 16;

			}

						canvas.onmousemove();
					}

				status.style.display = 'inline-block';
				return;
			}
		}
		canvas.onmouseout();
	}

	window.onkeydown = function() {
		if (event.ctrlKey && event.keyCode === 70) {

			search(false);
